    public function getUserProfileInfo(){
    	$user_id=$_GET['user_id'];

    	if($user_id){
	    $user_info=$this->vwm->getUserProfileInfo_Model($user_id,$image);
		$data=preFormat($user_info);
	    }
	    else{
	    	$data=customFormat(false,400,"Missing Parameters : user_id","Error!");
	    }

		jc($data);
    }

    public function login(){
        $username=$_GET['username'];
        $password=$_GET['password'];
        $lat=$_GET['latitude'];
        $lng=$_GET['longitude'];
        $user_type=$_GET['user_type'];
        

		if($username && $password && $user_type){
	      $data=$this->vwm->login_Model($username,$password,$lat,$lng,$user_type);
	    }
	    else{
	    	$data=customFormat(false,400,"Missing Parameters : username, password, user_type, latitude & longitude ","Error!");
	    }

		jc($data);
	}
	
    public function createAccount(){

		if($_REQUEST['username'] && $_REQUEST['password'] && $_REQUEST['email'] && $_REQUEST['first_name'] && $_REQUEST['last_name'] && $_REQUEST['user_type']){
	      $data=$this->vwm->createAccount_Model($_REQUEST);
	    }
	    else{
	    	$data=customFormat(false,400,"Mandatory Parameters : username, password, email, first_name, last_name & user_type","Error!");
	    }

		jc($data);
    }

    public function updateAccount(){
     
       if($_GET['user_id']){
	      $data=$this->vwm->updateAccount_Model();
	    }
	    else{
	    	$data=customFormat(false,400,"Mandatory Parameters: user_id, Supported Parameters : username,last_name,first_name,password,business_email,personal_email,address,city,state,zip,current_occupation, previous_occupation, certifications, education, associations, networks, interests, phone_number,social_media, user_type,latitude,longitude & public_profile","Error!");
	    }

		jc($data);

    }

	public function getAllResumeSnapshots(){
         
         $data=preFormat($this->vwm->getAllResumeSnapshots_Model());
         jc($data);
	}

	public function searchProfiles(){
      
