	    }
	    else{
	    	$data=customFormat(false,400,"Missing Parameters radius & public_profile","Error!");
	    }

		jc($data);
	}

	public function getProfile(){
		$user_id=$_GET['user_id'];

		if($user_id){
	      $data=$this->vwm->getProfile_Model($user_id);
	    }
	    else{
	    	$data=customFormat(false,400,"Missing Parameters : user_id ","Error!");
	    }

		jc($data);
	}

	public function getJob(){
		$job_id=$_GET['job_id'];

