	      $data=$this->vwm->getJob_Model($job_id);
	    }
	    else{
	    	$data=customFormat(false,400,"Missing Parameters : job_id ","Error!");
	    }

		jc($data);
	}

	public function updateProfileImage(){
		$user_id=$_REQUEST['user_id'];
